import React from "react";
import "./App.css";
import "./responsive.css";
import "react-toastify/dist/ReactToastify.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  BrowserRouter,
} from "react-router-dom";
import HomeScreen from "./screens/HomeScreen";
import SingleProduct from "./screens/SingleProduct";
import Login from "./screens/Login";
import Register from "./screens/Register";
import CartScreen from "./screens/CartScreen";
import ShippingScreen from "./screens/ShippingScreen";
import ProfileScreen from "./screens/ProfileScreen";
import PaymentScreen from "./screens/PaymentScreen";
import PlaceOrderScreen from "./screens/PlaceOrderScreen";
import OrderScreen from "./screens/OrderScreen";
import NotFound from "./screens/NotFound";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" elenment={<HomeScreen />} />

        <Route path="/page/:currentPage" elenment={<HomeScreen />} />

        <Route path="/products/:id" elenment={<SingleProduct />} />
        <Route path="/login" elenment={<Login />} />
        <Route path="/register" elenment={<Register />} />
        <Route path="/profile" elenment={<ProfileScreen />} />
        <Route path="/cart/:id?" elenment={<CartScreen />} />
        <Route path="/shipping" elenment={<ShippingScreen />} />
        <Route path="/payment" elenment={<PaymentScreen />} />
        <Route path="/placeorder" elenment={<PlaceOrderScreen />} />
        <Route path="/order/:id" elenment={<OrderScreen />} />
        <Route path="*" elenment={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
